import Header from "../Header";
import { useParams } from "react-router-dom";
import RoomsData from "../data/RoomsData";
import { useEffect } from "react";


export default function RoomDetail() {
    const { id } = useParams();
    useEffect(() => {
        RoomsData.filter(id)
    },[])
    return (
        <>
            <Header />

            <h1>room no: {id}</h1>
        </>
    )
}
